import React from "react";

import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import TextField from "@material-ui/core/TextField";
import FormControl from "@material-ui/core/FormControl";
import CurrencyTextField from "@unicef/material-ui-currency-textfield";
import Button from "@material-ui/core/Button";

import Sidebar from "../sidebar/Sidebar";
import TopBar from "../topbar/TopBar";
import BottomBar from "../bottombar/BottomBar";

export const SavingsAdd = () => {
  const [value, setValue] = React.useState(0.0);
  const error = value < 0.01;
  return (
    <div>
      <h1>
        Fill out this form to add any savings you have. Examples inclute savings
        accounts, 401k, roth IRA, and investments.
      </h1>
      <TextField
        id="filled-basic"
        label="Type of Savings?"
        variant="filled"
        fullWidth
        margin="normal"
      />
      <TextField
        id="filled-basic"
        label="Where are the savings being held?"
        variant="filled"
        fullWidth
        margin="normal"
      />
      <FormControl fullWidth>
        <CurrencyTextField
          variant="filled"
          label="Amount"
          value={value}
          currencySymbol="$"
          maximumValue={"100000000000000000"}
          autoFocus
          onChange={(e, value) => setValue(value)}
          error={error}
          helperText={"minimum number is .01"}
          decimalCharacter="."
          digitGroupSeparator=","
        />
      </FormControl>
      <TextField
        id="filled-basic"
        label="Any thoughts you'd like to record about this entry?"
        variant="filled"
        fullWidth
        multiline
        margin="normal"
      />
      <div>
        <Button variant="contained" color="primary">
          Add Another Entry
        </Button>
        <Button variant="contained" color="secondary">
          Done
        </Button>
      </div>
    </div>
  );
};
